description:
**Main Responsibilities**

* Build, release, and deploy the platform on top of Jupyter Lab and Jupyter Hub;
* Monitor the health of the platform and plan its capacity;
* Secure the platform to prevent security breaches or unintended usage;
* Tailor the platform to support evolving customer needs.
Monitor the results and quality of the different software solutions and projects implemented in the organisation  
* 



**Qualifications and Profile**

Intermediate level (at least 4 years of experience)  

* 



**Technical**

* Proficient in Linux, Docker, Kubernetes and Helm charts;
* Good experience with shell-scripting;
* Good experience with Git, ideally with Gitlab;
* Good experience with Continuous Delivery, ideally with ArgoCD;
* Good experience with Monitoring, ideally with Grafana;
Hands-on experience with Python or a similar programming language.  
* 



**Functional**

* Prior exposure to agile ways of working.
Financial/banking industry knowledge is a plus.  
* 



**O** **ther Professional Skills and Mind-set**

* Ability to think in the problem space, and then in the solution space;
* A bias for short, iterative and incremental way of working;
* A sense of compassion to appreciate our customers’ challenges;
* A learning mindset;
* Ability to communicate a point concisely and simply;
French speaking skills not necessary but appreciated.  
* 



**Education Requirements**

At least a Bachelor’s degree in any of these faculties:


* Computer Science
* Information Technology
* Programming & Systems Analysis
* Science (Computer Studies)
